import React, { useState, useEffect } from 'react';

const Results = ({ content }) => {
  const [images, setImages] = useState([]);

  if (content.length === 0) {
    return (
      <p>null</p>
    )
  } else if (content === "400") {
    return (
      <p>invalid input</p>
    )
  } else if (content === "error") {
    return (
      <p>error</p>
    )
  }
  else {
    try {
      var output = content;
      console.log(output);

      const columns = [
        { header: 'Name'},
        { header: 'Floor Price'},
        { header: 'Market Cap', accessor: 'email' },
      ];

      return (
        <div className="table-container">
          <table className="custom-table">
            <thead>
              <tr>
                {columns.map((column, index) => (
                  <th key={index}>{column.header}</th>
                ))}
              </tr>
            </thead>
            <tbody>
              {output.map((row, rowIndex) => (
                <tr key={rowIndex}>
                  <td>
                    <div>
                      <img src={row[2]} alt={row[0]} />
                      <p>{row[0]}</p>
                    </div>
                    
                  </td>
                  <td>{String(row[5]["floor_price"]) + " " + row[5]["floor_price_symbol"]}</td>
                  <td>{row[5]["market_cap"]}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      );
    } catch {
      return (
        <p>Unknown error</p>
      )
    }
  }
};
export default Results;
